import React from "react";
import "./signUp.css";
import { Link } from "react-router-dom";
import { useNavigate } from 'react-router-dom';
function SignUp() {
    const navigate = useNavigate();

    function handleClick(event) {

      navigate('/target-route');
    }
  return (
    <div className="signup">
      <span className="heading greet">Welcome To  </span>
      <span className="h1 heading "> Project Of Guvi Assienment</span>

      <span className=" heading emailtxt">Enter the email</span>

      <input
        className="form__inset"
        typeof="text"
        placeholder="Email"
        name="email"
      />
      <span className=" heading emailtxt">Enter the Password</span>

      <input
        className="form__inset"
        typeof="text"
        placeholder="Password"
        name="email"
      />
      <span className=" heading emailtxt">Enter the Conform Password</span>

      <input
        className="form__inset"
        typeof="text"
        placeholder="Password"
        name="email"
      />
      <span className=" heading emailtxt">
        If You Have Already Account Please <button type="button" onSubmit={handleClick}>Login</button>
      </span>
    </div>
  );
}

export default SignUp;
